INSERT INTO projet_sous_projet VALUES (1796,2563,2445,0,'0727','015',NULL,0,NULL,NULL,'Détaillage d''urgence pour combler le besoin de l''atelier (PO C17325-07950)\r\n******* NE PLUS METTRE D''HEURE DANS CE SOUS PROJET *********','Email recu de M.Duquette:\r\n\r\n---\r\n\r\nDe : Martin Duquette [mailto:martin.duquette@quirionmetal.com] \r\nEnvoyé : 18 janvier 2018 13:24\r\nÀ : Benoit Bergeron\r\nCc : Sarah Guilbault; Celia Piol; Martin Lachapelle; Côté, Augustin\r\nObjet : Re: 0727-Soprema Woodstock - Livraison de dessins\r\n\r\nBenoit,\r\n\r\nl''idée c''est que demain matin tu me confirmes ce que tu peux me sortir comme dessins au plus vite. Pour ton option 2, on doit considérer les réponses au plan de tie joists et tu sais comme moi que je viens de le recevoir final et que que je dois le clarifier parce qu''il y a encore des questions dessus pour l''EOR, ce qui est un peu une surprise ...\r\n\r\nPrends ce courriel comme acceptation du temps supplémentaire avec une surprime de 22$ de l''heure ( tu te sers du PO C17325-07950 ) mais je tiens à avoir des updates là dessus régulièrement. Je n''ouvre pas le bar et il ne faut surtout pas voir tout le reste du projet comme une source d''overtime. On a besoin de dessins mais pas de là à manger la job.\r\n\r\nMerci de ta collaboration\r\n',0,1,1,1,1,1,'2018-01-18 15:19:55',90);
